import React from "react";
import Header from "../../Header/Header";
import Slidetop from "../../Slidetop/Slidetop";
import Footer from "../../Footer/Foter";

const Coursepage = () => {
  return (
    <div>
      <Header />
      <Slidetop />
      <div className="detai-course"></div>
      <Footer />
    </div>
  );
};

export default Coursepage;
